import React,{Component} from 'react'
import Search from '../Coponent/Search';
import Navibar from '../Coponent/Navibar';

export default class Home extends Component {
    state={
        items:[]
    }
    updateitems =(i)=>{
        console.log("omg",i)
        let items=[...this.state.items,i]
        this.setState({
            items:items
        })
    }

    render() {
        const {items}=this.state

        return (
            <div>
                <Navibar />
                <Search updateitems={this.updateitems}/>
                list of posts
            {
                items.length ?
                items.map(item =>
                <div key={item.rid}>{item.description}</div>) :null
            }

            </div>
        );
    }
}
